       "          5.       ],\n",
       "        ...,\n",
       "        [-5.       , -4.8989899, -4.7979798, ...,  4.7979798,  4.8989899,\n",
       "          5.       ],\n",
       "        [-5.       , -4.8989899, -4.7979798, ...,  4.7979798,  4.8989899,\n",
       "          5.       ],\n",
